import React, { useEffect, useState } from "react";

const AddProductModal=({show, setShow, handleClose, handleShow})=>{
    return(
         <Modal
        size="md"
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title>Product</Modal.Title>
        </Modal.Header>
        <Modal.Body>

        </Modal.Body>
    </Modal>
    )
}

export default AddProductModal;
